import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    font-size: 1.1rem;
`;

let time = new Date().toLocaleString();

class Clock extends React.Component {
    render() {
        return (
            <Container>
                <div>{time}</div>
            </Container>
        );
    }
}
export default Clock;
